  CONSTRAINT `service_images_ibfk_1` FOREIGN KEY (`service`) REFERENCES `services` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

